package com.cooltra.zeus.stubs

import com.github.tomakehurst.wiremock.WireMockServer
import com.github.tomakehurst.wiremock.client.MappingBuilder
import com.github.tomakehurst.wiremock.client.WireMock
import com.github.tomakehurst.wiremock.client.WireMock.aResponse
import com.github.tomakehurst.wiremock.client.WireMock.containing
import com.github.tomakehurst.wiremock.client.WireMock.equalTo
import com.github.tomakehurst.wiremock.client.WireMock.urlMatching
import com.github.tomakehurst.wiremock.common.Slf4jNotifier
import com.github.tomakehurst.wiremock.core.WireMockConfiguration

class ArubaStub(configuration: WireMockConfiguration = WireMockConfiguration.options().dynamicPort()) {

  val server: WireMockServer

  init {
    configuration.notifier(Slf4jNotifier(false))
    server = WireMockServer(configuration)
  }

  fun start(): ArubaStub {
    server.start()
    defaultMapping()
    return this
  }

  fun stop() {
    server.stop()
  }

  fun port(): Int = server.port()

  fun reset() {
    server.resetAll()
    defaultMapping()
  }

  fun defaultMapping() {
    acceptSignIn()
    downloadInvoice()
  }

  fun on(mappingBuilder: MappingBuilder) = server.addStubMapping(mappingBuilder.build())

  fun acceptSignIn() {
    on(
      WireMock.post(urlMatching("/auth/signin"))
        .withHeader("Content-Type", equalTo("application/x-www-form-urlencoded;charset=UTF-8"))
        .withRequestBody(containing("grant_type=password"))
        .withRequestBody(containing("username=aruba-user"))
        .withRequestBody(containing("password=aruba-password"))
        .willReturn(
          aResponse()
            .withBody(
              """
            {
                "access_token": "aruba-token",
                "token_type": "bearer",
                "expires_in": 1799,
                "refresh_token": "72502d295e914b388a5b1e487c34c1a6",
                "as:client_id": "Auth",
                "userName": "DEMO00000000148",
                ".issued": "Fri, 16 Dec 2022 11:22:20 GMT",
                ".expires": "Fri, 16 Dec 2022 11:52:20 GMT"
            }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }

  fun acceptInvoice(documentId: String) {
    acceptSignIn()
    on(
      WireMock.post(urlMatching("/services/invoice/upload"))
        .willReturn(
          aResponse()
            .withBody(
              """
            {
              "errorCode" : "0000",
              "errorDescription" : "Operazione effettuata - 521e052902be7b879d41e0fd586f0e21",
              "uploadFileName" : "$documentId.xml.p7m"
            }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }

  fun downloadInvoice() {
    on(
      WireMock.get(urlMatching("/services/invoice/out/getByFilename.*"))
        .willReturn(
          aResponse()
            .withBody(
              """
                {
                    "id": "63bd831782e6314a675a7581",
                    "sender": {
                        "description": "Cooltra Motos Italia, S.R.L",
                        "countryCode": "IT",
                        "vatCode": "00000000148",
                        "fiscalCode": "00000000148"
                    },
                    "receiver": {
                        "description": "1000 MES 921 SL",
                        "countryCode": "ES",
                        "vatCode": "B65800971",
                        "fiscalCode": null
                    },
                    "file": "",
                    "filename": "IT01879020517A2022_eaaNK.xml.p7m",
                    "invoices": [
                        {
                            "invoiceDate": "2022-05-23T00:00:00.000+02:00",
                            "number": "MIR_1000002",
                            "status": "Inviata",
                            "statusDescription": ""
                        }
                    ],
                    "username": "DEMO00000000148",
                    "lastUpdate": "2023-01-10T15:24:07.344+00:00",
                    "idSdi": "510",
                    "creationDate": "2023-01-10T15:24:07.344+00:00",
                    "errorCode": "0000",
                    "errorDescription": null,
                    "pddAvailable": false,
                    "pdfFile": "",
                    "invoiceType": "FPR12",
                    "docType": "out"
                }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }

  fun acceptInvoiceWithError() {
    acceptSignIn()
    on(
      WireMock.post(urlMatching("/services/invoice/upload"))
        .willReturn(
          aResponse()
            .withBody(
              """
            {
              "errorCode" : "0092",
              "errorDescription" : "Errore in validazione XSD: cvc-pattern-valid: Value '00182 Roma' is not facet-valid with respect to pattern '[0-9][0-9][0-9][0-9][0-9]' for type 'CAPType'. Linea:45 Colonna:37 - 02b04d36e3e9e3f979bfd8d320cdac09",
              "uploadFileName" : ""
            }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }

  fun acceptSecondRequestInvoice(documentId: String) {
    acceptSignIn()
    on(
      WireMock.post(urlMatching("/services/invoice/upload"))
        .inScenario("send_aruba_request")
        .willSetStateTo("accept_second_aruba_request")
        .willReturn(
          aResponse()
            .withBody(
              """
            {
              "errorCode" : "0092",
              "errorDescription" : "Errore in validazione XSD: cvc-pattern-valid: Value '00182 Roma' is not facet-valid with respect to pattern '[0-9][0-9][0-9][0-9][0-9]' for type 'CAPType'. Linea:45 Colonna:37 - 02b04d36e3e9e3f979bfd8d320cdac09",
              "uploadFileName" : ""
            }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
    on(
      WireMock.post(urlMatching("/services/invoice/upload"))
        .inScenario("send_aruba_request")
        .whenScenarioStateIs("accept_second_aruba_request")
        .willReturn(
          aResponse()
            .withBody(
              """
            {
              "errorCode" : "0000",
              "errorDescription" : "Operazione effettuata - 521e052902be7b879d41e0fd586f0e21",
              "uploadFileName" : "$documentId.xml.p7m"
            }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }

  fun rejectSecondRequestWithInvoiceAlreadySent() {
    acceptSignIn()
    on(
      WireMock.post(urlMatching("/services/invoice/upload"))
        .inScenario("send_aruba_repeated_error_request")
        .willSetStateTo("request_with_error")
        .willReturn(
          aResponse()
            .withBody(
              """
            {
              "errorCode" : "0092",
              "errorDescription" : "Errore in validazione XSD: cvc-pattern-valid: Value '00182 Roma' is not facet-valid with respect to pattern '[0-9][0-9][0-9][0-9][0-9]' for type 'CAPType'. Linea:45 Colonna:37 - 02b04d36e3e9e3f979bfd8d320cdac09",
              "uploadFileName" : ""
            }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
    on(
      WireMock.post(urlMatching("/services/invoice/upload"))
        .inScenario("send_aruba_repeated_error_request")
        .whenScenarioStateIs("request_with_error")
        .willReturn(
          aResponse()
            .withBody(
              """
            {
              "errorCode" : "0034",
              "errorDescription" : "File già inviato di recente - 4a1b72f11cc44488061f1523be3097ee",
              "uploadFileName" : ""
            }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }

  fun isDown() {
    acceptSignIn()
    on(
      WireMock.post(urlMatching("/services/invoice/upload"))
        .willReturn(
          aResponse().withStatus(500),
        ),
    )
    on(
      WireMock.get(urlMatching("/services/invoice/out/getByFilename.*"))
        .willReturn(
          aResponse().withStatus(500),
        ),
    )
  }

  fun rejectGetPdf(documentId: String) {
    on(
      WireMock.get(urlMatching("/services/invoice/out/getByFilename.*"))
        .willReturn(
          aResponse()
            .withBody(
              """
                  {
                      "id": null,
                      "sender": null,
                      "receiver": null,
                      "filename": null,
                      "invoices": null,
                      "username": null,
                      "lastUpdate": null,
                      "idSdi": null,
                      "creationDate": null,
                      "errorCode": "0003",
                      "errorDescription": "Fattura con nome file $documentId.xml.p7m non presente o in corso di elaborazione",
                      "pddAvailable": false,
                      "invoiceType": null,
                      "docType": null
                  }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }

  fun rejectGetPdfWith002(documentId: String) {
    on(
      WireMock.get(urlMatching("/services/invoice/out/getByFilename.*"))
        .willReturn(
          aResponse()
            .withBody(
              """
                  {
                      "id": null,
                      "sender": null,
                      "receiver": null,
                      "filename": null,
                      "invoices": null,
                      "username": null,
                      "lastUpdate": null,
                      "idSdi": null,
                      "creationDate": null,
                      "errorCode": "0002",
                      "errorDescription": "Fattura con nome file $documentId.xml.p7m non presente o in corso di elaborazione",
                      "pddAvailable": false,
                      "invoiceType": null,
                      "docType": null
                  }
              """.trimIndent(),
            )
            .withStatus(200),
        ),
    )
  }
}
